//   reducer: {
//     user: userReducer,
//     projectactions: projectActionsReducer,
//   },
// });

const root_element = document.getElementById("root");
const react_root = createRoot(root_element);

react_root.render(
  <BrowserRouter>
    <Provider store={store}>
      <App />
    </Provider>
  </BrowserRouter>
);
